/* Simplifying diet */Vegan diet isn't simple it is has complex as other diets and vegan cuisine has developed since thousands of years in the world such as India. (Wikipedia should not spread the cliché that vegans are people who just eat savor less plants)
Veganism is not about minimalism but just about Eating healthier without violence or exploitation of animals..... If vegans were not caring about animals they would love to eat meat, honey, milk......
It might however a little less divers...
